#start-screen{position:fixed;inset:0;background:rgba(0,0,0,.72);z-index:3000;display:flex;flex-direction:column;justify-content:center;align-items:center;color:var(--tcol);text-align:center;padding:20px;}
#start-screen h1{font-size:clamp(2em,5vw,3.5em);margin-bottom:18px;text-shadow:0 0 20px rgba(0,0,0,.9);}
#start-screen p{font-size:clamp(1em,2.5vw,1.6em);margin-bottom:28px;text-shadow:0 0 10px rgba(0,0,0,.8);}
#start-btn{padding:18px 56px;font-size:22px;font-weight:bold;background:var(--ui);color:#fff;border:none;border-radius:50px;cursor:pointer;text-transform:uppercase;box-shadow:0 8px 24px rgba(0,0,0,.5);transition:transform .3s,box-shadow .3s;}
#start-btn:hover{transform:scale(1.08) translateY(-4px);box-shadow:0 14px 36px rgba(0,0,0,.7);}
#ui{position:absolute;top:0;width:100%;z-index:1000;pointer-events:none;}
#header{background:var(--ui);color:#fff;padding:9px;text-align:center;font-weight:bold;font-size:clamp(12px,2vw,18px);pointer-events:auto;}

#qbox{background:#fff;width:88%;max-width:520px;margin:8px auto;padding:12px 14px;border-radius:16px;text-align:center;box-shadow:0 6px 18px rgba(0,0,0,.3);pointer-events:auto;}

.shock{animation:shock .1s infinite;z-index:10!important;}

#gameover-screen{text-align:center;color:var(--tcol);text-shadow:2px 2px 4px rgba(0,0,0,.7);}
#gameover-screen h1{font-size:clamp(2em,5vw,3.5em);animation:bounceIn 1s ease-out;margin-bottom:20px;}
#gameover-screen button{padding:14px 42px;border-radius:28px;border:none;background:var(--ui);color:#fff;font-size:18px;cursor:pointer;font-weight:bold;}
@keyframes bounceIn{0%{opacity:0;transform:scale(.3)}20%{transform:scale(1.1)}40%{transform:scale(.9)}60%{opacity:1;transform:scale(1.03)}80%{transform:scale(.97)}100%{opacity:1;transform:scale(1)}}
@keyframes pondSlide{0%{transform:translateY(0);opacity:1}50%{transform:translateY(100vh);opacity:0}51%{transform:translateY(-100vh);opacity:0}100%{transform:translateY(0);opacity:1}}
.pond-transition{animation:pondSlide 1.2s ease-in-out;}
#fxCanvas{position:absolute;top:0;left:0;width:100%;height:100%;z-index:2001;pointer-events:none;}
#vol-ctrl{position:absolute;top:46px;right:14px;background:rgba(255,255,255,.92);padding:7px 13px;border-radius:22px;display:flex;align-items:center;gap:8px;z-index:2000;pointer-events:auto;box-shadow:0 3px 12px rgba(0,0,0,.2);border:2px solid var(--ui);}
#vol-slider{cursor:pointer;accent-color:var(--ui);width:72px;}
@keyframes countPulse{0%{transform:scale(.4);opacity:0}50%{transform:scale(1.3);opacity:1}100%{transform:scale(1);opacity:0}}
.count-anim{animation:countPulse .9s ease-out forwards;}
#brand-logo{position:fixed;bottom:52px;right:12px;width:70px;height:auto;opacity:0.85;z-index:1500;pointer-events:none;filter:drop-shadow(0 2px 6px rgba(0,0,0,.5));transition:opacity .3s;display:none;}
#brand-logo:hover{opacity:1;}
#copyright{position:fixed;bottom:0;left:0;width:100%;background:rgba(0,0,0,.55);color:rgba(255,255,255,.75);font-size:10px;text-align:center;padding:4px 8px;z-index:1500;pointer-events:none;letter-spacing:.3px;font-family:Arial,sans-serif;display:none;}

<script>
var LB={"1":[{"q":"1+1","options":["2","5","8"],"correct":0}],"2":[{"q":"2+2","options":["4","5","6"],"correct":0}],"3":[]};
var LEVELS_META={"1":{"name":"1+1","hero":"","platform":"","bg":""},"2":{"name":"2+2","hero":"","platform":"","bg":""},"3":{"name":"","hero":"","platform":"","bg":""}};
var TDUR=15;
var ETIMER=true;
var VTXT="ПОБЕДА! 🎉";
var VMSG="Отличная работа! Ты справился!";
var GOTXT="ИГРА ОКОНЧЕНА 😢";
var VEFF="fireworks";
var PDIR="down";
var CPIMG="";
var GPS=100/100;
var GPSP=100/100;
var GPC=100;
var TR={ru:{level:"УРОВЕНЬ",question:"Вопрос",outOfTime:"Время вышло!",go:"ВПЕРЁД!"},en:{level:"LEVEL",question:"Question",outOfTime:"Out of time!",go:"GO!"},de:{level:"STUFE",question:"Frage",outOfTime:"Zeit ab!",go:"LOS!"}};
var t=TR["ru"];
var currentLevel=1,step=0,lives=5,questions=[],timer=null,lastLeaf=null,gvol=0.5,jumping=false;
function getLevelTitle(lvl){var m=LEVELS_META[lvl];if(m&&m.name)return m.name;return t.level+" "+lvl;}
function applyLevelAssets(lvl){var m=LEVELS_META[lvl]||{};var body=document.body;if(m.bg){body.style.background="url("+JSON.stringify(m.bg)+") no-repeat center/cover";}else{body.style.background="";}var frogEl=document.getElementById("frog");if(m.hero){frogEl.style.backgroundImage="url("+JSON.stringify(m.hero)+")";frogEl.style.backgroundRepeat="no-repeat";frogEl.style.backgroundSize="contain";frogEl.style.backgroundPosition="center";}else{frogEl.style.backgroundImage="";}var platImg=m.platform||"";document.querySelectorAll(".leaf").forEach(function(lf){if(platImg){lf.style.backgroundImage="url("+JSON.stringify(platImg)+")";lf.style.backgroundSize="contain";lf.style.backgroundRepeat="no-repeat";}else{lf.style.backgroundImage="";}});}
function mkAudio(src){if(!src)return null;try{return new Audio(src);}catch(e){return null;}}
var sounds={start:mkAudio("https://raw.githubusercontent.com/vivanova288-boop/froggy-quest-builder-v3/main/1.mp3"),jump:mkAudio("https://raw.githubusercontent.com/vivanova288-boop/froggy-quest-builder-v3/main/2.mp3"),shock:mkAudio("https://raw.githubusercontent.com/vivanova288-boop/froggy-quest-builder-v3/main/3.mp3"),lose:mkAudio("https://raw.githubusercontent.com/vivanova288-boop/froggy-quest-builder-v3/main/4.mp3"),win:mkAudio("https://raw.githubusercontent.com/vivanova288-boop/froggy-quest-builder-v3/main/5.mp3"),level:mkAudio("https://raw.githubusercontent.com/vivanova288-boop/froggy-quest-builder-v3/main/6.mp3"),count:mkAudio("https://raw.githubusercontent.com/vivanova288-boop/froggy-quest-builder-v3/main/7.mp3")};
function playSound(s){if(!s)return;try{s.currentTime=0;s.volume=gvol;s.play();}catch(e){}}
document.getElementById("vol-slider").addEventListener("input",function(e){gvol=parseFloat(e.target.value);document.getElementById("vol-icon").textContent=gvol===0?"🔇":"🔊";});
var pond=document.getElementById("pond"),frog=document.getElementById("frog");
var fxC=document.getElementById("fxCanvas"),ctx=fxC.getContext("2d");
function szC(){fxC.width=innerWidth;fxC.height=innerHeight;}window.addEventListener("resize",szC);szC();
function hideStart(){document.getElementById("start-screen").style.display="none";initGame();}
function createPond(){pond.querySelectorAll(".leaf").forEach(function(l){l.remove();});var R=7,C=5;var platImg=LEVELS_META[currentLevel]&&LEVELS_META[currentLevel].platform||"";for(var r=0;r<R;r++)for(var c=1;c<4;c++){var l=document.createElement("div");l.className="leaf";if(platImg){l.style.backgroundImage="url("+JSON.stringify(platImg)+")";l.style.backgroundSize="contain"; l.style.backgroundPosition="center"; l.style.backgroundRepeat="no-repeat";l.style.backgroundRepeat="no-repeat";}var cw=100/(C-1),off=(r%2===0)?0:cw/2,lp=50+((c*cw+off)-62.5)*1.2;l.style.left=lp+"%";l.style.top=((r/(R-1))*65+5)+"%";l.id="leaf-"+r+"-"+c;pond.appendChild(l);}}
function initGame(){pond.classList.remove("pond-transition");var cov=document.getElementById("countdown-overlay");var ctxt=document.getElementById("countdown-text");document.getElementById("overlay").style.display="none";Object.values(sounds).forEach(function(s){if(s){try{s.pause();s.currentTime=0;}catch(e){}}});currentLevel=1;step=0;lives=5;updateLives();createPond();cov.style.display="flex";var csteps=["3","2","1",t.go];var ci=0;if(window._cdTimer)clearTimeout(window._cdTimer);if(sounds.count){sounds.count.currentTime=0;sounds.count.volume=gvol;sounds.count.play().catch(function(){});}function _showCd(){if(ci<csteps.length){ctxt.textContent=csteps[ci];ctxt.classList.remove("count-anim");void ctxt.offsetWidth;ctxt.classList.add("count-anim");ci++;window._cdTimer=setTimeout(_showCd,1000);}else{if(sounds.count){sounds.count.pause();sounds.count.currentTime=0;}cov.style.display="none";frog.style.opacity=1;startGameLogic();}}_showCd();}
function shuffle(a){var b=[].concat(a);for(var i=b.length-1;i>0;i--){var j=Math.floor(Math.random()*(i+1));var x=b[i];b[i]=b[j];b[j]=x;}return b;}
function startGameLogic(){
playSound(sounds.start);
document.getElementById("header").textContent=getLevelTitle(currentLevel);
applyLevelAssets(currentLevel);
var qs=shuffle(LB[currentLevel]||[]).slice(0,6);
questions=qs.map(function(q){var opts=shuffle([].concat(q.options));return{q:q.q,options:opts,correct:opts.indexOf(q.options[q.correct])};});
frog.classList.remove("sink","super-jump","shock");
lastLeaf=document.getElementById("leaf-6-2");
document.querySelectorAll(".leaf").forEach(function(l){l.classList.remove("active","leaf-landed","shock");});
if(lastLeaf)lastLeaf.classList.add("active");
frog.style.transition="none";mvFrog(lastLeaf);
setTimeout(function(){frog.style.transition="left .6s cubic-bezier(.47,1.21,.58,1),top .6s cubic-bezier(.47,1.21,.58,1),transform .3s";loadLevel();},50);
}
function updateLives(){var c=document.getElementById("lives-wrap");c.innerHTML="";for(var i=0;i<lives;i++){var d=document.createElement("div");d.className="life-icon";c.appendChild(d);}}
function loadLevel(){
jumping=false;
if(step>=questions.length){
var nxt=currentLevel+1;
if(LB[nxt]&&LB[nxt].length>0){
frog.classList.add("super-jump");playSound(sounds.level);
setTimeout(function(){
pond.classList.add("pond-transition");
setTimeout(function(){
currentLevel++;step=0;
var qs2=shuffle(LB[currentLevel]||[]).slice(0,6);
questions=qs2.map(function(q){var opts=shuffle([].concat(q.options));return{q:q.q,options:opts,correct:opts.indexOf(q.options[q.correct])};});
document.getElementById("header").textContent=getLevelTitle(currentLevel);
applyLevelAssets(currentLevel);
frog.classList.remove("super-jump");frog.style.transition="none";
lastLeaf=document.getElementById("leaf-6-2");mvFrog(lastLeaf);
setTimeout(function(){pond.classList.remove("pond-transition");frog.style.transition="left .6s cubic-bezier(.47,1.21,.58,1),top .6s cubic-bezier(.47,1.21,.58,1),transform .3s";loadLevel();},50);
},600);},400);return;
}showEnd(VTXT);return;}
document.querySelectorAll(".leaf.active").forEach(function(l){l.classList.remove("active","leaf-landed");l.textContent="";l.onclick=null;delete l.dataset.letter;});
if(lastLeaf)lastLeaf.classList.add("active");
var q=questions[step];
document.getElementById("q-text").innerHTML="<b>"+t.question+" "+(step+1)+":</b> "+q.q;
var row=5-step;
[1,2,3].forEach(function(c,i){var lf=document.getElementById("leaf-"+row+"-"+c);if(lf){lf.classList.add("active");lf.dataset.letter=String.fromCharCode(65+i);lf.textContent=q.options[i];(function(idx,leaf){lf.onclick=function(){hJump(idx,leaf);};})(i,lf);}});
if(ETIMER)startTimer();
}
function hJump(i,leaf){
if(jumping)return;jumping=true;clearInterval(timer);mvFrog(leaf);
if(i===questions[step].correct){
lastLeaf=leaf;leaf.classList.add("leaf-landed");playSound(sounds.jump);
setTimeout(function(){var x=leaf.offsetLeft+leaf.offsetWidth/2,y=leaf.offsetTop+leaf.offsetHeight/2;mkSplash(x,y);},300);
setTimeout(function(){step++;jumping=false;loadLevel();},700);
}else{
playSound(sounds.shock);leaf.classList.add("shock");frog.classList.add("shock");
lives--;updateLives();
setTimeout(function(){
mvFrog(lastLeaf);
setTimeout(function(){leaf.classList.remove("shock");frog.classList.remove("shock");},300);
if(lives<=0)showEnd(GOTXT);
else setTimeout(function(){jumping=false;loadLevel();},400);
},150);
}}
function mkSplash(x,y){var s=document.createElement("div");s.className="splash";s.style.left=x+"px";s.style.top=y+"px";pond.appendChild(s);setTimeout(function(){s.remove();},600);}
function mvFrog(leaf){if(!leaf||frog.classList.contains("super-jump"))return;frog.style.zIndex="999";frog.classList.add("jumping-frog");frog.style.left=(leaf.offsetLeft+leaf.offsetWidth/2)+"px";frog.style.top=(leaf.offsetTop+leaf.offsetHeight/2)+"px";setTimeout(function(){frog.classList.remove("jumping-frog");},600);}
function startTimer(){var pct=100;clearInterval(timer);timer=setInterval(function(){pct-=(100/(TDUR*10));document.getElementById("tfill").style.width=Math.max(0,pct)+"%";if(pct<=0){clearInterval(timer);onTimeout();}},100);}
function onTimeout(){playSound(sounds.shock);frog.classList.add("shock");lives--;updateLives();setTimeout(function(){frog.classList.remove("shock");if(lives<=0)showEnd(GOTXT);else{jumping=false;loadLevel();}},800);}
var parts=[],animId=null;
function mkP(type,x,y){
var p={x:x||Math.random()*fxC.width,y:y||Math.random()*fxC.height,a:1};
if(type==="fire"){var ang=Math.random()*Math.PI*2,sp=(Math.random()*5+2)*GPSP;p.vx=Math.cos(ang)*sp;p.vy=Math.sin(ang)*sp;p.col="hsl("+(Math.random()*360)+",100%,50%)";p.dec=Math.random()*.03+.01;p.t="fire";}
else if(type==="conf"){p.x=Math.random()*fxC.width;p.y=-20;p.sz=(Math.random()*10+5)*GPS;p.vx=(Math.random()*4-2)*GPSP;p.vy=(Math.random()*5+3)*GPSP;p.rot=Math.random()*360;p.rs=(Math.random()*10-5)*GPSP;p.col="hsl("+(Math.floor(Math.random()*360))+",100%,50%)";p.dec=0;p.t="conf";}
else if(type==="star"){p.x=Math.random()*fxC.width;p.y=-20;p.sz=(Math.random()*8+4)*GPS;p.vy=(Math.random()*3+2)*GPSP;p.tw=Math.random()*Math.PI*2;p.dec=0;p.t="star";}
else if(type==="heart"){p.sz=(Math.random()*28+18)*GPS;p.vx=(Math.random()*2-1)*GPSP;p.vy=(Math.random()*-3-1)*GPSP;p.g=.12*GPSP;p.rot=Math.random()*360;p.rs=(Math.random()*4-2)*GPSP;p.a=Math.random()*.4+.3;p.hue=Math.floor(Math.random()*60+300);p.dec=0;p.t="heart";}
else if(type==="bubble"){p.x=Math.random()*fxC.width;p.y=fxC.height+20;p.sz=(Math.random()*28+10)*GPS;p.vx=(Math.random()*2-1)*GPSP;p.vy=(Math.random()*2+1)*-GPSP;p.a=Math.random()*.4+.3;p.wb=Math.random()*Math.PI*2;p.dec=0;p.t="bubble";}
else if(type==="coin"){p.x=Math.random()*fxC.width;p.y=-20;p.sz=(Math.random()*18+12)*GPS;p.vx=(Math.random()*2-1)*GPSP;p.vy=(Math.random()*4+2)*GPSP;p.flip=0;p.fs=(.05+Math.random()*.03)*GPSP;p.dec=0;p.t="coin";}
else if(type==="snow"){p.x=Math.random()*fxC.width;p.y=-20;p.sz=(Math.random()*6+3)*GPS;p.vx=(Math.random()*2-1)*GPSP;p.vy=(Math.random()*2+1)*GPSP;p.rot=Math.random()*360;p.rs=(Math.random()*2-1)*GPSP;p.a=Math.random()*.5+.5;p.dec=0;p.t="snow";}
else if(type==="flower"){p.x=Math.random()*fxC.width;p.y=-20;p.sz=(Math.random()*14+8)*GPS;p.vx=(Math.random()*2-1)*GPSP;p.vy=(Math.random()*2+1)*GPSP;p.rot=Math.random()*360;p.rs=(Math.random()*4-2)*GPSP;p.a=Math.random()*.6+.4;p.hue=Math.floor(Math.random()*60+300);p.dec=0;p.t="flower";}
else if(type==="custom"){var bs=5*GPSP,dir=PDIR;p.sz=40*GPS;p.rot=Math.random()*360;p.rs=(Math.random()*4-2)*GPSP;p.a=Math.random()*.5+.5;if(dir==="down"){p.x=Math.random()*fxC.width;p.y=-p.sz;p.vx=(Math.random()*2-1)*bs;p.vy=bs;}else if(dir==="up"){p.x=Math.random()*fxC.width;p.y=fxC.height+p.sz;p.vx=(Math.random()*2-1)*bs;p.vy=-bs;}else if(dir==="explode"){p.x=fxC.width/2;p.y=fxC.height/2;var ang2=Math.random()*Math.PI*2;p.vx=Math.cos(ang2)*bs;p.vy=Math.sin(ang2)*bs;}else{p.x=Math.random()*fxC.width;p.y=Math.random()*fxC.height;p.vx=(Math.random()-.5)*bs*2;p.vy=(Math.random()-.5)*bs*2;}p.dec=0;p.t="custom";}
else if(type==="sparkle"){p.x=Math.random()*fxC.width;p.y=Math.random()*fxC.height;p.sz=(Math.random()*12+6)*GPS;p.a=Math.random()*.8+.2;p.life=Math.random()*30+10;p.maxLife=p.life;p.hue=Math.floor(Math.random()*60+40);p.dec=0;p.t="sparkle";}
else if(type==="rainbow"){p.x=Math.random()*fxC.width;p.y=-20;p.sz=(Math.random()*8+4)*GPS;p.vy=(Math.random()*3+2)*GPSP;p.vx=(Math.random()*2-1)*GPSP;p.hue=Math.floor(Math.random()*360);p.dec=0;p.t="rainbow";}
else if(type==="diamond"){p.x=Math.random()*fxC.width;p.y=-20;p.sz=(Math.random()*14+8)*GPS;p.vx=(Math.random()*2-1)*GPSP;p.vy=(Math.random()*3+2)*GPSP;p.rot=Math.random()*360;p.rs=(Math.random()*4-2)*GPSP;p.a=Math.random()*.6+.4;p.dec=0;p.t="diamond";}
else if(type==="sunshine"){p.x=fxC.width/2+(Math.random()-0.5)*fxC.width*.8;p.y=0;p.sz=(Math.random()*20+10)*GPS;p.vy=(Math.random()*2+1)*GPSP;p.vx=(Math.random()*2-1)*GPSP*0.5;p.rot=Math.random()*360;p.rs=(Math.random()*3-1.5)*GPSP;p.a=Math.random()*.7+.3;p.dec=0;p.t="sunshine";}
else if(type==="magic"){var ang3=Math.random()*Math.PI*2,sp3=(Math.random()*4+1)*GPSP;p.x=Math.random()*fxC.width;p.y=Math.random()*fxC.height;p.vx=Math.cos(ang3)*sp3;p.vy=Math.sin(ang3)*sp3;p.sz=(Math.random()*10+5)*GPS;p.hue=Math.floor(Math.random()*360);p.tw=Math.random()*Math.PI*2;p.dec=0;p.t="magic";}
return p;}
function drawP(p){
ctx.save();ctx.globalAlpha=p.a;
if(p.t==="fire"){ctx.beginPath();ctx.arc(p.x,p.y,2,0,Math.PI*2);ctx.fillStyle=p.col;ctx.fill();}
else if(p.t==="conf"){ctx.translate(p.x,p.y);ctx.rotate(p.rot*Math.PI/180);ctx.fillStyle=p.col;ctx.fillRect(-p.sz/2,-p.sz/2,p.sz,p.sz);}
else if(p.t==="star"){ctx.globalAlpha=p.a*(Math.sin(p.tw)*.3+.7);ctx.fillStyle="#FFD700";ctx.beginPath();for(var i=0;i<5;i++){var a=(Math.PI*2*i)/5-Math.PI/2;ctx.lineTo(p.x+Math.cos(a)*p.sz,p.y+Math.sin(a)*p.sz);}ctx.closePath();ctx.fill();}
else if(p.t==="heart"){ctx.translate(p.x,p.y);ctx.rotate(p.rot*Math.PI/180);ctx.fillStyle="hsl("+p.hue+",100%,60%)";var s=p.sz;ctx.beginPath();ctx.moveTo(0,s/4);ctx.bezierCurveTo(-s/2,-s/4,-s,s/4,0,s);ctx.bezierCurveTo(s,s/4,s/2,-s/4,0,s/4);ctx.fill();}
else if(p.t==="bubble"){var g=ctx.createRadialGradient(p.x-p.sz/4,p.y-p.sz/4,0,p.x,p.y,p.sz);g.addColorStop(0,"rgba(255,255,255,.8)");g.addColorStop(.5,"rgba(173,216,230,.4)");g.addColorStop(1,"rgba(100,149,237,.2)");ctx.fillStyle=g;ctx.beginPath();ctx.arc(p.x,p.y,p.sz,0,Math.PI*2);ctx.fill();}
else if(p.t==="coin"){ctx.translate(p.x,p.y);ctx.scale(Math.abs(Math.cos(p.flip)),1);var g2=ctx.createRadialGradient(-p.sz*.3,-p.sz*.3,0,0,0,p.sz);g2.addColorStop(0,"#FFF9C4");g2.addColorStop(.4,"#FFD700");g2.addColorStop(.8,"#FFA500");g2.addColorStop(1,"#B8860B");ctx.fillStyle=g2;ctx.beginPath();ctx.arc(0,0,p.sz,0,Math.PI*2);ctx.fill();ctx.fillStyle="#B8860B";ctx.font="bold "+(p.sz*.9)+"px Arial";ctx.textAlign="center";ctx.textBaseline="middle";ctx.fillText("$",0,0);}
else if(p.t==="snow"){ctx.translate(p.x,p.y);ctx.rotate(p.rot*Math.PI/180);ctx.strokeStyle="#FFF";ctx.lineWidth=2;for(var i=0;i<6;i++){ctx.save();ctx.rotate(Math.PI*2*i/6);ctx.beginPath();ctx.moveTo(0,0);ctx.lineTo(0,p.sz);ctx.stroke();ctx.restore();}}
else if(p.t==="flower"){ctx.translate(p.x,p.y);ctx.rotate(p.rot*Math.PI/180);ctx.fillStyle="hsl("+p.hue+",100%,70%)";for(var i=0;i<5;i++){ctx.save();ctx.rotate(Math.PI*2*i/5);ctx.beginPath();ctx.ellipse(0,-p.sz*.5,p.sz*.4,p.sz*.6,0,0,Math.PI*2);ctx.fill();ctx.restore();}ctx.fillStyle="#FFD700";ctx.beginPath();ctx.arc(0,0,p.sz*.3,0,Math.PI*2);ctx.fill();}
else if(p.t==="custom"&&cpImg&&cpImg.complete){ctx.translate(p.x,p.y);ctx.rotate(p.rot*Math.PI/180);ctx.drawImage(cpImg,-p.sz/2,-p.sz/2,p.sz,p.sz);}
else if(p.t==="sparkle"){ctx.fillStyle="hsl("+p.hue+",100%,90%)";var fade=p.life/p.maxLife;ctx.globalAlpha=p.a*fade;for(var i=0;i<4;i++){ctx.save();ctx.translate(p.x,p.y);ctx.rotate(Math.PI/4*i);ctx.beginPath();ctx.moveTo(0,-p.sz);ctx.lineTo(p.sz*.15,0);ctx.lineTo(0,p.sz);ctx.lineTo(-p.sz*.15,0);ctx.closePath();ctx.fill();ctx.restore();}}
else if(p.t==="rainbow"){ctx.beginPath();ctx.arc(p.x,p.y,p.sz,0,Math.PI*2);ctx.fillStyle="hsl("+p.hue+",100%,60%)";ctx.fill();}
else if(p.t==="diamond"){ctx.translate(p.x,p.y);ctx.rotate(p.rot*Math.PI/180);var g3=ctx.createLinearGradient(-p.sz,-p.sz,p.sz,p.sz);g3.addColorStop(0,"#E0FFFF");g3.addColorStop(.3,"#B0E0E6");g3.addColorStop(.6,"#87CEEB");g3.addColorStop(1,"#4169E1");ctx.fillStyle=g3;ctx.beginPath();ctx.moveTo(0,-p.sz);ctx.lineTo(p.sz*.6,0);ctx.lineTo(0,p.sz);ctx.lineTo(-p.sz*.6,0);ctx.closePath();ctx.fill();ctx.strokeStyle="rgba(255,255,255,.7)";ctx.lineWidth=1;ctx.stroke();}
else if(p.t==="sunshine"){ctx.translate(p.x,p.y);ctx.rotate(p.rot*Math.PI/180);ctx.fillStyle="#FFD700";ctx.strokeStyle="#FFA500";ctx.lineWidth=2;ctx.beginPath();ctx.arc(0,0,p.sz*.5,0,Math.PI*2);ctx.fill();for(var i=0;i<8;i++){ctx.save();ctx.rotate(Math.PI*2*i/8);ctx.beginPath();ctx.moveTo(0,p.sz*.6);ctx.lineTo(0,p.sz);ctx.stroke();ctx.restore();}}
else if(p.t==="magic"){ctx.fillStyle="hsl("+p.hue+",100%,70%)";ctx.shadowColor="hsl("+p.hue+",100%,80%)";ctx.shadowBlur=8;ctx.beginPath();for(var i=0;i<5;i++){var a2=(Math.PI*2*i)/5-Math.PI/2;ctx.lineTo(p.x+Math.cos(a2)*p.sz*(Math.sin(p.tw)*.3+.7),p.y+Math.sin(a2)*p.sz*(Math.sin(p.tw)*.3+.7));}ctx.closePath();ctx.fill();ctx.shadowBlur=0;}
ctx.restore();}
function updP(p){
if(p.t==="fire"){p.vx*=.99;p.vy*=.99;p.vy+=.05;p.x+=p.vx;p.y+=p.vy;p.a-=p.dec;}
else if(p.t==="conf"){p.vy+=.2*GPSP;p.x+=p.vx;p.y+=p.vy;p.rot+=p.rs;if(p.y>fxC.height)p.a-=.02;}
else if(p.t==="star"){p.y+=p.vy;p.tw+=.1;if(p.y>fxC.height)p.a-=.02;}
else if(p.t==="heart"){p.vy+=p.g;p.x+=p.vx;p.y+=p.vy;p.rot+=p.rs;if(p.y>fxC.height+50)p.a-=.01;}
else if(p.t==="bubble"){p.wb+=.1;p.x+=p.vx+Math.sin(p.wb)*.5;p.y+=p.vy;if(p.y<-p.sz)p.a-=.02;}
else if(p.t==="coin"){p.flip+=p.fs;p.y+=p.vy;p.x+=p.vx;if(p.y>fxC.height)p.a-=.02;}
else if(p.t==="snow"){p.y+=p.vy;p.x+=p.vx;p.rot+=p.rs;if(p.y>fxC.height)p.a-=.01;}
else if(p.t==="flower"){p.y+=p.vy;p.x+=p.vx;p.rot+=p.rs;if(p.y>fxC.height)p.a-=.01;}
else if(p.t==="custom"){p.x+=p.vx;p.y+=p.vy;p.rot+=p.rs;if(p.x<-p.sz||p.x>fxC.width+p.sz||p.y<-p.sz||p.y>fxC.height+p.sz)p.a-=.02;}
else if(p.t==="sparkle"){p.life--;if(p.life<=0)p.a=0;}
else if(p.t==="rainbow"){p.y+=p.vy;p.x+=p.vx;p.hue=(p.hue+2)%360;if(p.y>fxC.height)p.a-=.02;}
else if(p.t==="diamond"){p.y+=p.vy;p.x+=p.vx;p.rot+=p.rs;if(p.y>fxC.height)p.a-=.02;}
else if(p.t==="sunshine"){p.y+=p.vy;p.x+=p.vx;p.rot+=p.rs;if(p.y>fxC.height)p.a-=.02;}
else if(p.t==="magic"){p.x+=p.vx;p.y+=p.vy;p.tw+=.1;p.hue=(p.hue+3)%360;p.vx*=.98;p.vy*=.98;if(Math.abs(p.vx)<0.1&&Math.abs(p.vy)<0.1)p.a-=.02;}
}
var cpImg=null;if(CPIMG){cpImg=new Image();cpImg.src=CPIMG;}
function spawnEff(eff){
var n=Math.max(1,Math.round(GPC/10));
if(eff==="fireworks"){for(var i=0;i<Math.round(5*n);i++)parts.push(mkP("fire",Math.random()*fxC.width,Math.random()*fxC.height*.7));}
else if(eff==="confetti"){for(var i=0;i<Math.round(1*n);i++)parts.push(mkP("conf"));}
else if(eff==="stars"){for(var i=0;i<Math.round(1*n);i++)parts.push(mkP("star"));}
else if(eff==="hearts"){for(var i=0;i<Math.round(1*n);i++)parts.push(mkP("heart"));}
else if(eff==="sparkles"){for(var i=0;i<Math.round(3*n);i++)parts.push(mkP("sparkle"));}
else if(eff==="bubbles"){for(var i=0;i<Math.round(1*n);i++)parts.push(mkP("bubble"));}
else if(eff==="rainbow"){for(var i=0;i<Math.round(2*n);i++)parts.push(mkP("rainbow"));}
else if(eff==="gold"){for(var i=0;i<Math.round(1*n);i++)parts.push(mkP("coin"));}
else if(eff==="diamonds"){for(var i=0;i<Math.round(1*n);i++)parts.push(mkP("diamond"));}
else if(eff==="snow"){for(var i=0;i<Math.round(1*n);i++)parts.push(mkP("snow"));}
else if(eff==="flowers"){for(var i=0;i<Math.round(1*n);i++)parts.push(mkP("flower"));}
else if(eff==="sunshine"){for(var i=0;i<Math.round(2*n);i++)parts.push(mkP("sunshine"));}
else if(eff==="magic"){for(var i=0;i<Math.round(3*n);i++)parts.push(mkP("magic"));}
else if(eff==="custom"){for(var i=0;i<Math.round(1*n);i++)parts.push(mkP("custom"));}
}
function animLoop(){animId=requestAnimationFrame(animLoop);ctx.clearRect(0,0,fxC.width,fxC.height);parts=parts.filter(function(p){updP(p);drawP(p);return p.a>0;});if(Math.random()<.1)spawnEff(VEFF);}
function stopFx(){cancelAnimationFrame(animId);animId=null;parts=[];ctx.clearRect(0,0,fxC.width,fxC.height);}
function showEnd(txt){
document.getElementById("overlay").style.display="flex";
if(txt===VTXT){
document.getElementById("victory-modal").style.display="block";
document.getElementById("gameover-screen").style.display="none";
document.getElementById("v-title").textContent=VTXT;
document.getElementById("v-msg").textContent=VMSG;
playSound(sounds.win);
if(VEFF!=="none"){fxC.style.display="block";animLoop();setTimeout(stopFx,6000);}
}else{
document.getElementById("victory-modal").style.display="none";
document.getElementById("gameover-screen").style.display="block";
document.getElementById("go-text").textContent=GOTXT;
playSound(sounds.lose);stopFx();fxC.style.display="none";
}}
</script>
</body>
